<!DOCTYPE html>
<html>

<head>
	<meta charset="utf-8">
	<meta name="viewport" content="width=device-width, initial-scale=1">
	<title>Under construction</title>
	<style type="text/css">
		html,
		body {
			box-sizing: border-box;
			margin: 0;
			padding: 0;
			font-family: cursive, monospace, Verdana, Arial, sans-serif, serif, monospace;
		}

		.wrapper {
			width: 100vw;
			height: 100vh;
			background: #f5f5f5;
			display: flex;
			justify-content: center;
			align-items: center;
		}

		.container {
			height: auto;
			width: 450px;
			display: flex;
			flex-direction: column;
			justify-content: center;
			align-items: center;
		}

		.icon {
			height: 250px;
			width: 250px;
			position: relative;
		}

		.icon>img {
			height: 100%;
			width: 100%;
		}

		.title {
			font-size: 45px;
			font-weight: 600;
		}
	</style>
</head>

<body>

	<div class="wrapper">
		<div class="container">
			<div class="icon">
				<img src="data:image/png;base64," />
			</div>
			<div class="title">Under Construction</div>
			<div class="sub_title">The developement of this website is under construction</div>
		</div>
	</div>

</body>

</html>